import React from "react";
import "../style/mid.css";
import Home from "../Components/Home";

function Mid() {
  return (
    <div class="container-fluid" id="test">
      <div class="row">
        <div class="col">text</div>
      </div>
      <div class="row">
        <div class="col">image</div>
      </div>
    </div>
  );
}

export default Mid;
